import "./projects.scss"
import FadeInSection from "./fading";

export default function Projects(){
// This data contains a list of all projects data added to the Projects section on the website 
    const data = [
    {
        id: 1,
        img: "/assets/wc.png",
        year: "May 2021",
        title: "FINAL YEAR THESIS",
        desc: " Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
        git :"https://github.com/willianck/Thesis",
        skills: 'Python FlairNLP',
        style: {
            "transition-delay": "300ms"
        }
    },

    {
        id: 2,
        img: "/assets/farm.png",
        year: "May 2021",
        title:"PREDICTING FOOD INSECURITY",
        desc: "Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
        git:'https://github.com/willianck/ADS',
        skills: 'Python FlairNLP',
        featured: true,
        style: {
            "transition-delay": "500ms"
        }


    },

    {
        id: 3,
        img: "/assets/sceemspace.jpg",
        year:"May 2020",
        title: "SCEEM SPACE",
        desc:"ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
        git:"https://github.com/willianck/SCEEMSPACE",
        skills: 'Python FlairNLP',
        style: {
            "transition-delay": "100ms"
        }
    }
]




    return (
        <div className = "projects" id = 'projects'>
            <FadeInSection>
            <h1><i class="fas fa-code"></i> Projects</h1>
            </FadeInSection>
            <div className='container'>
                  {data.map((d)=>(

                <FadeInSection style={d.style}>
                <div className ="items">
                        {/* <FadeInSection> */}
                        <div className ='top'>
                          <img src = {d.img} alt=''/>
                          <p>{d.year}</p>
                      </div>

                        <div className ='center'>
                            <h3>{d.title}</h3>
                             <p>{d.desc}</p>
                        </div>

                        <div className = 'bottom'>
                        <a href={d.git}><i class="fab fa-github"></i></a>
                        <p>{d.skills}</p>
                        </div>
                        {/* </FadeInSection> */}
                 </div>
                 </FadeInSection>
                ))}

            </div>
        </div>
    );
}
